Question: How to get the value of a JComboBox in a JTextField

I have a JComboBox and a JTextField. I want to get the value of the JComboBox in the JTextField. How can I do this?

Answer:

\begin{code}
JComboBox comboBox = new JComboBox();
JTextField textField = new JTextField();
textField.setEditable(false);
textField.setValue(comboBox.getSelectedItem().toString());
